import React from "react";
import { Box, Center, HStack, Pressable } from "native-base";

export default function App() {
  return (
    <Center h="100vh" bg="coolGray.900">
      <Box position="relative">
        <HStack mb="3" space="3">
          <Pressable>
            {({ isHovered }) => (
              <Box
                h="150px"
                w="150px"
                postion="absolute"
                roundedTopLeft="full"
                bg="white"
                left={isHovered ? "-8px" : "0"}
                top={isHovered ? "-8px" : "0"}
              ></Box>
            )}
          </Pressable>
          <Pressable>
            {({ isHovered }) => (
              <Box
                h="150px"
                w="150px"
                postion="absolute"
                roundedTopRight="full"
                bg="white"
                left={isHovered ? "8px" : "0"}
                top={isHovered ? "-8px" : "0"}
              ></Box>
            )}
          </Pressable>
        </HStack>
        <HStack space="3">
          <Pressable>
            {({ isHovered }) => (
              <Box
                h="150px"
                w="150px"
                postion="absolute"
                roundedBottomLeft="full"
                bg="white"
                left={isHovered ? "-8px" : "0"}
                bottom={isHovered ? "-8px" : "0"}
              ></Box>
            )}
          </Pressable>
          <Pressable>
            {({ isHovered }) => (
              <Box
                h="150px"
                w="150px"
                postion="absolute"
                roundedBottomRight="full"
                bg="white"
                right={isHovered ? "8px" : "0"}
                bottom={isHovered ? "-8px" : "0"}
              ></Box>
            )}
          </Pressable>
        </HStack>
      </Box>
    </Center>
  );
}
